(1, 1, '2002-02-20', '0000-00-00', '3 exemplaires Fleurs à couper, beaucoup de fleurs si engrais', '', NULL, NULL),
(2, 2, '2002-02-20', '0000-00-00', '', '', NULL, NULL),
(3, 3, '2002-02-20', '0000-00-00', '2 exemplaires', 'Belle fleur d’un rouge foncé velouté, délicieusement parfumée. Rosier vigoureux, paré d’un beau feuillage vert foncé. Diamètre fleur 12 cm. Hauteur : 80/90 cm.\r\nTRÈS PARFUMÉE \r\nColoris : Rouge\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs ', NULL, NULL),
(4, 4, '2002-02-20', '0000-00-00', 'Très beau parfum, tendance à perdre ses feuilles, plus grand que 80 cm', '', NULL, NULL),
(5, 5, '2003-02-20', '2012-03-15', 'Très beau parfum. Pas très sain. Souvent les fleurs sont groupées. Fleur qui s\'ouvre - on voit les étamines.', '', 1, NULL),
(6, 6, '2007-03-20', '0000-00-00', 'Très belles fleurs groupées, mais sensibles à la pluie', '', NULL, NULL),
(7, 7, '2007-03-20', '0000-00-00', '', '', NULL, NULL),
(8, 8, '2005-11-20', '0000-00-00', '', 'Plante très résistante, portant d’énormes fleurs romantiques blanc crème bordées de rose carmin pâle, au subtil parfum de pêche mûre. Feuillage brillant. Environ 90 à 100 pétales. Médaille d\'argent à Saverne. Diamètre fleur 14 cm. Hauteur 90/110 cm.\r\nPARFUMÉE \r\nColoris : Bicolore, Rose, Blanc\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs ', NULL, NULL),
(9, 9, '2005-11-20', '0000-00-00', 'Remarquable par sa couleur', 'Une parure exceptionnelle blanc crème à liseré rouge amarante pour cette somptueuse rose de 30 pétales au parfum léger. Beau feuillage vert foncé brillant. Rosier sain et vigoureux, de forme régulière et équilibrée, qui fleurit et refleurit à profusion. Médaille d\'argent à Le Roeulx. Diamètre fleur 14 cm. Hauteur 70/80 cm.\r\nColoris : Bicolore, Rose, Blanc\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs ', NULL, NULL),
(10, 10, '2004-02-20', '0000-00-00', 'Très grande fleur en mai, très vigureux', 'Sans doute la rose la plus célèbre et la plus cultivée au monde.\r\nConnue aussi sous le nom de \"Peace\", elle fut offerte aux 49 Délégués qui se réunirent à San Francisco en 1945 pour constituer l\'Organisation des Nations Unies (ONU). A obtenu l’AARS (All América Rose Sélection), récompense la plus prestigieuse aux USA. Elue \"Rose Favorite du Monde Entier\". Diamètre fleur 15 cm. Hauteur 80/90 cm.\r\nColoris : Jaune, Bicolore, Rose\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs ', NULL, NULL),
(11, 11, '2007-02-20', '0000-00-00', 'Très grandes fleurs en mai', 'Grosses fleurs jaune canari bordées de carmin. Rosier très vigoureux à grand développement. Hauteur : 3 m et plus.\r\nColoris : Jaune, Bicolore\r\nUsage(s) : Murs et Clôtures\r\nFamille(s) : Grimpants ', NULL, NULL),
(12, 12, '2008-10-20', '0000-00-00', '2 exemplaires', '', NULL, NULL),
(13, 13, '2007-11-20', '2012-03-15', '', '', NULL, NULL),
(15, 15, '2008-02-20', '0000-00-00', 'Belles fleurs groupées', '', NULL, NULL),
(16, 16, '2009-11-15', '0000-00-00', '', ' 	 La rose Meilland la plus noire. Cette rose d’environ 40 pétales présente un coloris rouge grenat velouté très foncé, dont les reflets en fonction de l’éclairage peuvent donner l’illusion d’une rose noire. Très bonne tenue en vase. Diamètre fleur 11 cm. Hauteur 90/100 cm.\r\n\r\nColoris : Rouge, Noire\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs', NULL, NULL),
(17, 17, '2006-11-20', '0000-00-00', 'Très grandes fleurs en mai', 'Magnifique rose jaune d\'or bordé de rouge groseille d\'environ 45 pétales au puissant parfum rose de mai. Variété vigoureuse bénéficiant d’une floraison abondante et ininterrompue. Très bonne résistance aux maladies. Feuillage dense, vert foncé mi-mat. Bonne tenue en vase. Diamètre fleur 14 cm. Hauteur : 70/80 cm.', NULL, NULL),
(18, 18, '2005-02-20', '0000-00-00', '', '', NULL, NULL),
(19, 19, '2008-03-20', '0000-00-00', 'Très résistant', '', NULL, NULL),
(20, 20, '2008-03-20', '0000-00-00', 'Très résistant', '', NULL, NULL),
(21, 21, '2008-03-20', '0000-00-00', 'Très résistant', '', NULL, NULL),
(22, 22, '2009-03-20', '0000-00-00', 'x2. Très beau rosier', 'Avec sa forme de rose à l\'ancienne et son délicat coloris rose tendre ombré de rose carmin, ce rosier grimpant est rapidement devenu quasi incontournable pour tous les jardins. Pierre de Ronsard ® s\'est vu décerner en 2006 la récompense suprême de la Fédération Mondiale des Sociétés de Roses en étant élu « Rose Favorite du Monde Entier ». Environ 70 pétales. Hauteur environ 2 m et plus.\r\n\r\nMeilland est l\'obtenteur qui totalise le plus grand nombre de récompenses avec Mme A. Meilland, Papa Meilland ®, Bonica ®, et maintenant Pierre de Ronsard ®, sa 4ème variété élue.\r\nPARFUMÉE \r\nColoris : Rose, Blanc\r\nUsage(s) : Murs et Clôtures\r\nFamille(s) : Grimpants ', NULL, NULL),
(23, 23, '2007-11-20', '0000-00-00', '', '', NULL, NULL),
(24, 24, '2008-11-20', '0000-00-00', '', '', NULL, NULL),
(25, 25, '2002-03-20', '0000-00-00', '', '', NULL, NULL),
(26, 26, '2008-03-20', '0000-00-00', '', '', NULL, NULL),
(27, 27, '2007-02-20', '0000-00-00', 'Pas très remontant, perd ses feuilles', '', NULL, NULL),
(28, 28, '2003-02-20', '0000-00-00', 'Très vigoureux', '', NULL, NULL),
(29, 29, '2007-11-20', '0000-00-00', '', 'Cette fleur romantique, qui évoque irrésistiblement la célèbre roseraie, est un grand classique de Meilland : 65 pétales s\'ouvrant en coupe en un coloris blanc crème ombré de rose sur le pourtour, avec un parfum suave et prononcé. Rosier vigoureux, paré d\'un beau feuillage dense et fleurissant d\'abondance. Six récompenses dont la Coupe du parfum de Bagatelle et la Médaille d\'or de Genève. Diamètre fleur 12 cm. Hauteur 90/100 cm.\r\nTRÈS PARFUMÉE \r\nColoris : Blanc, Rose\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs', NULL, NULL),
(30, 30, '2007-11-20', '0000-00-00', '2 exemplaires', '', NULL, NULL),
(31, 31, '2007-11-20', '0000-00-00', '', 'Variété puissante et très résistante aux maladies. Jolie rose d\'un coloris jaune mimosa plus ou moins soutenu, d’environ 45 pétales au parfum subtil rosé épicé miel. Floraison très abondante, feuillage veiné très décoratif. Bonne tenue en vase. Prix du parfum à La Haye 2001. Diamètre fleur 12 cm. Hauteur 110/130 cm.\r\nPARFUMÉE \r\nColoris : Jaune\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs', NULL, NULL),
(32, 32, '2007-02-17', '0000-00-00', '', 'Renommée pour ses fleurs gracieuses rose carminé, sur de longues tiges. Plante très vigoureuse, très saine et très florifère. Diamètre fleur 10 cm. Hauteur : 100/110 cm.\r\nColoris : Rose\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs ', NULL, NULL),
