(41, 41, '2008-11-20', '0000-00-00', '', 'Une forme de rose ancienne, et un coloris blanc exhalant un léger parfum, sur une fleur de plus de 100 pétales. Le feuillage est foncé, vert moyen brillant, sur une végétation très forte. Hauteur : 2 m et plus.\r\nPARFUMÉE \r\nColoris : Blanc\r\nUsage(s) : Murs et Clôtures\r\nFamille(s) : Grimpants ', NULL, NULL),
(42, 42, '2007-11-20', '0000-00-00', 'Résistant aux maladies', '', NULL, NULL),
(44, 44, '2009-11-21', '0000-00-00', '', '', NULL, NULL),
(45, 45, '2009-11-21', '0000-00-00', '', '', NULL, NULL),
(46, 46, '2009-11-21', '0000-00-00', '', ' 	\r\nGrande rose de 50 à 55 pétales au coloris original, ocré teinté de jaune, d\'orange et de rose, au parfum rosé et fruité banane. Floraison abondante sur un feuillage décoratif brillant, résistant aux maladies. Prix du parfum à Bagatelle et Tokyo. A obtenu l’AARS (All América Rose Sélection), récompense la plus prestigieuse aux USA. Diamètre fleur 13 cm. Hauteur : 80/90 cm.\r\nTRÈS PARFUMÉE \r\nColoris : Bicolore, Rose\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs ', NULL, NULL),
(47, 249, '2009-11-21', '0000-00-00', '', '', NULL, NULL),
(48, 48, '2009-11-21', '0000-00-00', '', '', NULL, NULL),
(49, 49, '2009-11-21', '0000-00-00', 'Très florifère', 'Nul mieux que le grand artiste ne méritait cette superbe rose pimpante, d\'un gai coloris orange capucine, qu\'agrémente un parfum léger. Vigoureux, très résistant, ce rosier fleurit généreusement pendant toute la belle saison et porte un feuillage brillant et veiné très décoratif. Trois médailles dont l’or à Genève et à Monza. Environ 20 pétales. Diamètre fleur 14 cm. Hauteur 100/110 cm.\r\nPARFUMÉE \r\nColoris : Orange, Cuivrée\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs ', NULL, NULL),
(50, 50, '2009-11-21', '0000-00-00', 'Très belle fleur', 'Ce rosier grimpant à tout pour séduire : de grandes fleurs légèrement parfumées à la forme de roses anciennes et un charmant coloris pastel orange mandarine clair, le tout sur une plante solide avec une remontée marquée. Hauteur : 200 cm et plus.\r\nPARFUMÉE \r\nColoris : Cuivrée, Orange\r\nUsage(s) : Murs et Clôtures\r\nFamille(s) : Grimpants ', NULL, NULL),
(51, 51, '2009-11-21', '0000-00-00', 'Remarquable par sa couleur', 'Du plus bel effet décoratif, ce rosier ne manque pas d’atouts pour séduire. Le coloris jaune ourlé de rose bengale, le parfum fruité rose de thé, le contraste des fleurs sur le feuillage foncé agrémentent une plante très saine et à la végétation régulière. A obtenu l’AARS (All America Rose Sélection), récompense la plus prestigieuse aux USA. Rose d\'or du public à Baden. Environ 50 pétales. Bonne tenue en vase. Diamètre fleur 14 cm. Hauteur 80/90 cm.\r\nPARFUMÉE \r\nColoris : Bicolore, Jaune, Rose\r\nUsage(s) : Massif, Vase-bouquets, Bordures\r\nFamille(s) : Grandes fleurs\r\n', NULL, NULL),
(52, 52, '2009-11-15', '0000-00-00', '', 'Une rose hors du commun par la plénitude de ses formes, son parfum puissant et son riche coloris velours pourpre irisé de cramoisi avec des reflets noirs bleutés. Plante de bonne vigueur, revêtue d\'un ample feuillage. Hauteur : environ 3 m et plus.\r\nTRÈS PARFUMÉE \r\nColoris : Rouge\r\nUsage(s) : Murs et Clôtures\r\nFamille(s) : Grimpants ', NULL, NULL),
